--
-- Create procedure `test`
--
CREATE PROCEDURE test (IN p_offset int, IN p_keyword varchar(255), IN p_ids text)
SQL SECURITY INVOKER
BEGIN

  SET @KeyWord = CONCAT('%', p_keyword, '%');
  SET @index = 0;

  CREATE TEMPORARY TABLE IF NOT EXISTS temporary_fixed_asset AS
  SELECT
    fa.fixed_asset_id,
    fa.fixed_asset_code,
    fa.fixed_asset_name,
    fa.organization_id,
    fa.organization_code,
    fa.organization_name,
    fa.department_id,
    fa.department_code,
    fa.department_name,
    fa.fixed_asset_category_id,
    fa.fixed_asset_category_code,
    fa.fixed_asset_category_name,
    fa.purchase_date,
    fa.cost,
    fa.cost_source,
    fa.quantity,
    fa.depreciation_rate,
    fa.tracked_year,
    fa.life_time,
    fa.production_year,
    fa.active,
    fa.created_by,
    fa.created_date,
    fa.modified_by,
    fa.modified_date,
    fa.cost * fa.depreciation_rate AS depreciation_value_year,
    TIMESTAMPDIFF(MONTH, fa.production_year, CURDATE()) AS month_diff,
    TIMESTAMPDIFF(MONTH, fa.production_year, CURDATE()) * ((fa.cost * fa.depreciation_rate) / 12) AS depreciation_value,
    fa.cost - TIMESTAMPDIFF(MONTH, fa.production_year, CURDATE()) * ((fa.cost * fa.depreciation_rate) / 12) AS residual_value
  FROM fixed_asset fa
  WHERE (fa.fixed_asset_code LIKE @KeyWord
  OR fa.fixed_asset_name LIKE @KeyWord
  OR p_keyword IS NULL)
  ORDER BY fa.modified_date DESC;



  SET @deleteQuery = CONCAT('CREATE TEMPORARY TABLE IF NOT EXISTS temporary_fixed_asset_filter_not_in AS 
                               SELECT @index:=@index+1 AS ''index'',tfa.* FROM temporary_fixed_asset tfa
                               WHERE tfa.fixed_asset_id NOT IN ', p_ids, 'AND tfa.active = FALSE');

  PREPARE deleteQuery FROM @deleteQuery;
  EXECUTE deleteQuery;
  DEALLOCATE PREPARE deleteQuery;


  SELECT
    *
  FROM temporary_fixed_asset_filter_not_in;




  -- Xóa đi bảng tạm nếu có tồn tại
  DROP TEMPORARY TABLE IF EXISTS temporary_fixed_asset;
  DROP TEMPORARY TABLE IF EXISTS temporary_fixed_asset_filter_not_in;


END
$$

