    fa.cost - TIMESTAMPDIFF(MONTH, fa.production_year, CURDATE()) * ((fa.cost * fa.depreciation_rate) / 12) AS residual_value
  FROM fixed_asset fa
  WHERE (fa.fixed_asset_code LIKE @KeyWord
  OR fa.fixed_asset_name LIKE @KeyWord
  OR p_keyword IS NULL)
  ORDER BY fa.modified_date DESC;


  IF (p_not_in_ids IS NULL
    AND p_active_ids IS NULL) THEN
    SET @deleteQuery = 'CREATE TEMPORARY TABLE IF NOT EXISTS temporary_fixed_asset_filter_not_in AS 
                             SELECT @index:=@index+1 AS ''index'',tfa.* FROM temporary_fixed_asset tfa';
  ELSE
    IF (p_not_in_ids IS NULL) THEN
      SET @deleteQuery = CONCAT('CREATE TEMPORARY TABLE IF NOT EXISTS temporary_fixed_asset_filter_not_in AS 
                               SELECT @index:=@index+1 AS ''index'',tfa.* FROM temporary_fixed_asset tfa
                               WHERE (tfa.fixed_asset_id IN', p_active_ids, 'AND tfa.active = TRUE)');
    ELSE
      IF (p_active_ids IS NULL) THEN
        SET @deleteQuery = CONCAT('CREATE TEMPORARY TABLE IF NOT EXISTS temporary_fixed_asset_filter_not_in AS 
                                 SELECT @index:=@index+1 AS ''index'',tfa.* FROM temporary_fixed_asset tfa
                                 WHERE (tfa.fixed_asset_id NOT IN ', p_not_in_ids, 'AND tfa.active = FALSE)');
      ELSE
        SET @deleteQuery = CONCAT('CREATE TEMPORARY TABLE IF NOT EXISTS temporary_fixed_asset_filter_not_in AS 
                                 SELECT @index:=@index+1 AS ''index'',tfa.* FROM temporary_fixed_asset tfa
                                 WHERE (tfa.fixed_asset_id NOT IN ', p_not_in_ids, 'AND tfa.active = FALSE)
                                 OR (tfa.fixed_asset_id IN', p_active_ids, 'AND tfa.active = TRUE)');
      END IF;
    END IF;
  END IF;

  PREPARE deleteQuery FROM @deleteQuery;
  EXECUTE deleteQuery;
  DEALLOCATE PREPARE deleteQuery;


  SELECT
    *
  FROM temporary_fixed_asset_filter_not_in
  LIMIT p_limit
  OFFSET p_offset;


  -- Lấy ra tổng số bản ghi trong bảng tạm
  SELECT
    COUNT(*) AS total_record
  FROM temporary_fixed_asset_filter_not_in;

  -- Lấy ra tổng của số lượng trong bảng tạm
  SELECT
    SUM(quantity) AS quantity_total
  FROM temporary_fixed_asset_filter_not_in;

  -- Lấy ra tổng của nguyên giá trong bảng tạm
  SELECT
    SUM(cost) AS cost_total
  FROM temporary_fixed_asset_filter_not_in;

  -- Lấy ra tổng của hao mòn lũy kế trong bảng tạm
  SELECT
    SUM(depreciation_value) AS depreciation_value_total
  FROM temporary_fixed_asset_filter_not_in;

  -- Lấy ra tổng của các giá trị còn lại dương trong bảng tạm
  SELECT
    SUM(tfa.residual_value) AS residual_value_total
  FROM temporary_fixed_asset_filter_not_in tfa
  WHERE tfa.residual_value > 0;

  -- Xóa đi bảng tạm nếu có tồn tại
  DROP TEMPORARY TABLE IF EXISTS temporary_fixed_asset;
  DROP TEMPORARY TABLE IF EXISTS temporary_fixed_asset_filter_not_in;


END
$$

