--
-- Create procedure `Proc_FixedAssetIncrement_Filter`
--
CREATE PROCEDURE Proc_FixedAssetIncrement_Filter (IN p_keyword text, IN p_limit int, IN p_offset int)
SQL SECURITY INVOKER
COMMENT 'Lọc chứng từ theo mã chứng từ, ghi chú'
BEGIN
  SET @KeyWord = CONCAT('%', p_keyword, '%');
  SET @index = 0;

  -- Tạo bảng tạm chứa danh sách thông tin của tài sản theo bộ lọc và tìm kiếm
  CREATE TEMPORARY TABLE IF NOT EXISTS temporary_fixed_asset_increment AS
  SELECT
    @index := @index + 1 AS 'index',
    fai.voucher_id,
    fai.voucher_code,
    fai.voucher_date,
    fai.increment_date,
    fai.price,
    fai.description,
    fai.created_by,
    fai.created_date,
    fai.modified_by,
    fai.modified_date
  FROM fixed_asset_increment fai
  WHERE (fai.voucher_code LIKE @KeyWord
  OR fai.description LIKE @KeyWord
  OR p_keyword IS NULL)
  ORDER BY fai.modified_date DESC;

  -- Nếu limit = 0 thì lấy ra toàn bộ danh sách
  IF p_limit = 0 THEN
    SELECT
      *
    FROM temporary_fixed_asset_increment;
  ELSE
    -- Nếu limit != 0 thì lấy danh sách theo limit và offset
    SELECT
      *
    FROM temporary_fixed_asset_increment
    LIMIT p_limit
    OFFSET p_offset;
  END IF;

  -- Lấy ra tổng số bản ghi
  SELECT
    COUNT(*)
  FROM temporary_fixed_asset_increment tfai;

  -- Lấy ra tổng số nguyên giá
  SELECT
    SUM(tfai.price)
  FROM temporary_fixed_asset_increment tfai;

  -- Xóa đi bảng tạm nếu có tồn tại
  DROP TEMPORARY TABLE IF EXISTS temporary_fixed_asset_increment;
END
$$

