CREATE PROCEDURE Proc_FixedAssetIncrement_GetById (IN p_voucher_id char(36))
SQL SECURITY INVOKER
COMMENT 'Lấy thông tin chứng từ theo id'
BEGIN
  -- Lấy ra thông tin chứng từ
  SELECT
    fai.voucher_id,
    fai.voucher_code,
    fai.voucher_date,
    fai.increment_date,
    fai.price,
    fai.description
  FROM fixed_asset_increment fai
  WHERE fai.voucher_id = p_voucher_id;

  -- Lấy ra thông tin danh sách tài sản chứng từ 
  SET @index = 0;
  SELECT
    @index := @index + 1 AS 'index',
    fa.fixed_asset_id,
    fa.fixed_asset_code,
    fa.fixed_asset_name,
    fa.department_name,
    fa.fixed_asset_category_name,
    fa.cost,
    fa.cost_source,
    fa.quantity,
    TIMESTAMPDIFF(MONTH, fa.production_year, CURDATE()) * ((fa.cost * fa.depreciation_rate) / 12) AS depreciation_value,
    fa.cost - TIMESTAMPDIFF(MONTH, fa.production_year, CURDATE()) * ((fa.cost * fa.depreciation_rate) / 12) AS residual_value
  FROM fixed_asset_increment_detail faid
    LEFT JOIN fixed_asset fa
      ON faid.fixed_asset_id = fa.fixed_asset_id
  WHERE faid.voucher_id = p_voucher_id
  ORDER BY faid.created_date;
