$$

--
-- Create procedure `Proc_FixedAsset_Filter`
--
CREATE PROCEDURE Proc_FixedAsset_Filter (IN p_department_id char(36), IN p_asset_category_id char(36), IN p_keyword varchar(255), IN p_limit int, IN p_offset int)
SQL SECURITY INVOKER
COMMENT 'Lọc tài sản theo mã tài sản, tên tài sản, id phòng ban, id loại tài sản'
BEGIN
  SET @KeyWord = CONCAT('%', p_keyword, '%');
  SET @index = 0;
  -- Tạo bảng tạm chứa danh sách thông tin của tài sản theo bộ lọc và tìm kiếm
  CREATE TEMPORARY TABLE IF NOT EXISTS temporary_fixed_asset AS
  SELECT
    @index := @index + 1 AS 'index',
    fa.fixed_asset_id,
    fa.fixed_asset_code,
    fa.fixed_asset_name,
    fa.organization_id,
    fa.organization_code,
    fa.organization_name,
    fa.department_id,
    fa.department_code,
    fa.department_name,
    fa.fixed_asset_category_id,
    fa.fixed_asset_category_code,
    fa.fixed_asset_category_name,
    fa.purchase_date,
    fa.cost,
    fa.cost_source,
    fa.quantity,
    fa.depreciation_rate,
    fa.tracked_year,
    fa.life_time,
    fa.production_year,
    fa.active,
    fa.created_by,
    fa.created_date,
    fa.modified_by,
    fa.modified_date,
    fa.cost * fa.depreciation_rate AS depreciation_value_year,
    TIMESTAMPDIFF(MONTH, fa.production_year, CURDATE()) AS month_diff,
    TIMESTAMPDIFF(MONTH, fa.production_year, CURDATE()) * ((fa.cost * fa.depreciation_rate) / 12) AS depreciation_value,
    fa.cost - TIMESTAMPDIFF(MONTH, fa.production_year, CURDATE()) * ((fa.cost * fa.depreciation_rate) / 12) AS residual_value,
    fai.voucher_code
  FROM fixed_asset fa
    LEFT JOIN fixed_asset_increment_detail faid
      ON fa.fixed_asset_id = faid.fixed_asset_id
    LEFT JOIN fixed_asset_increment fai
      ON faid.voucher_id = fai.voucher_id
  WHERE (fa.department_id = p_department_id
  OR p_department_id IS NULL
  OR p_department_id = '')
  AND (fa.fixed_asset_category_id = p_asset_category_id
  OR p_asset_category_id IS NULL
  OR p_asset_category_id = '')
  AND (fa.fixed_asset_code LIKE @KeyWord
  OR fa.fixed_asset_name LIKE @KeyWord
  OR p_keyword IS NULL)
  ORDER BY fa.modified_date DESC;

  -- Nếu limit = 0 thì lấy tất cả danh sách trong bảng tạm
  IF p_limit = 0 THEN
    SELECT
      *
    FROM temporary_fixed_asset;
  ELSE
    -- Nếu limit khác không thì lấy danh sách trong bảng tạm theo limit và offet 
    SELECT
      *
    FROM temporary_fixed_asset
    LIMIT p_limit
    OFFSET p_offset;
  END IF;

  -- Lấy ra tổng số bản ghi trong bảng tạm
  SELECT
    COUNT(*) AS total_record
  FROM temporary_fixed_asset;

  -- Lấy ra tổng của số lượng trong bảng tạm
  SELECT
    SUM(quantity) AS quantity_total
  FROM temporary_fixed_asset;

  -- Lấy ra tổng của nguyên giá trong bảng tạm
  SELECT
    SUM(cost) AS cost_total
  FROM temporary_fixed_asset;

  -- Lấy ra tổng của hao mòn lũy kế trong bảng tạm
  SELECT
    SUM(depreciation_value) AS depreciation_value_total
  FROM temporary_fixed_asset;

  -- Lấy ra tổng của các giá trị còn lại dương trong bảng tạm
  SELECT
    SUM(tfa.residual_value) AS residual_value_total
  FROM temporary_fixed_asset tfa
  WHERE tfa.residual_value > 0;

  -- Xóa đi bảng tạm nếu có tồn tại
  DROP TEMPORARY TABLE IF EXISTS temporary_fixed_asset;

END
$$

DELIMITER ;

